import React from "react";
import './App.css';
import {BrowserRouter as Router, Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Link to="/">Home</Link>
        <Link to="/view-invoice">View Invoice</Link>
        <Link to="/create-invoice">Create Invoice</Link>
        <Link to="/edit-invoice">Edit Invoice</Link>


      </Router>
    </div>
  );
}

export default App;
